(99, '824150427162', '0824150427162', '', '8241504271622', NULL, 1, 8, 'POM', 'Green Tea, Light, Pomegranate Hibiscus', 'Only 35 calories per serving. Paradise found. Flavor breezes through our all-natural Pomegranate Hibiscus Light Pom Tea. Its a lightly floral green tea made from the finest Far East tea leaves. Our tea is gently brewed, and brims with powerful pomegranate antioxidants and the tropical nuances of sweet hibiscus. A delicately delicious balance with just 35 calories and less than 2mg of caffeine per serving. Our secret: Pom. An ultra-potent, 100%-pure polyphenol antioxidant extract made from the same California pomegranates we use to make our Pom Wonderful 100% Pomegranate Juice. That\'s flower power for you. All natural. Very low caffeine.', 2.99, 1439306795, 0, 1, 2, 4),
(100, '824150404163', '0824150404163', '', '8241504041638', NULL, 12, 64, 'Pom ', '100% Juice, Pomegranate Blueberry', 'From concentrate with added natural flavors. Perishable. All natural. 100% California pomegranates. Drink it daily. Feel it forever. 100% juice. Flash pasteurized.', 4.08, 1439306795, 0, 1, 2, 4),
